import React, { Component } from 'react';
import { Link } from 'react-router-dom';

class LogIn extends Component {
  constructor(props) {
    super(props)
    // BINDING GOES HERE
  }


  render() {
    return(
      <div className='log-in'>
        <h2> Log-In </h2>
        <Link to='/signup'>
          Sign Up
        </Link>
      </div>
    )
  }
}

export default LogIn;
